Fanny and Alexander are the children in the exuberant and colorful Ekdahl
household in a Swedish town early in the twentieth century. Their parents,
Oscar and Emilie, are the director and the leading lady of the local theatre
company. Oscar's mother and brother are its chief patrons.
After Oscar's early death, his widow has to marry the bishop and moves with
her children to his austere and forbidding chancery. The children become
immediately miserable.

